src/basics.html.body:
Getting Started
Before installing anything, you can start off by modeling an interface that represents your client-server interactions. The definition of this interface along with types used within it will be shared between the client and the server, later on you will reference this shared file from both projects. Such interface is represented in F# as a record with the fields of the record being functions. 
Suppose you are modelling an API for a music store, then it would look something like this:
// SharedModels.fs
module ShareModels

open System 

type Album = {
    Id : int
    Title : string
    Genre : string
    Released : DateTime
}

// The shared interface representing your client-server interaction
type IMusicStore = {
    popularAlbums : Async> 
    allAlbums : unit -> Async> 
    albumById : int -> Async>
    createAlbum : string -> string -> DateTime -> Async>
 }

As you can see, our interface is the IMusicStore record the fields of such record are functions of the shape:
Async 
'A -> Async
'A -> 'B -> Async
'A -> 'B -> 'C -> Async

// etc...

Provide an implementation
On the server, you would provide an implementation of the above API. 
let musicStore : IMusicStore = {
    popularAlbums = async {
        // getAllAlbums : unit -> Async>
        let! albums =  Database.getAllAlbums() 

        let popularAlbums = 
            List.filter (fun album -> album.Popular) albums

        return popularAlbums 
    }

    allAlbums = fun () -> Database.getAllAlbums() 

    albumById = fun id -> async {
        // findAlbumById : int -> Async>
        let! album = Databse.findAlbumById id
        return album
    }

    createAlbum = fun title genre released -> async { (* you get the idea *) }
}

Now you are almost ready to expose the API to your client and have these functions being callable directly. Start by setting up the server with your web framework of choice: 

Setup Suave
Setup Giraffe
Setup Saturn

Afterwards you can setup Fable Client

src/giraffe.html.body:
Setup Giraffe
On your Giraffe project, you reference the the shared API types:



Now you need to install the Suave-specific package: Fable.Remoting.Giraffe:
paket add Fable.Remoting.Giraffe --project path/to/Server.fsproj
Expose the API as a HttpHandler:
// Program.fs

open Giraffe
open SharedModels
open Fable.Remoting.Server
open Fable.Remoting.Giraffe

let musicStore : IMusicStore = {
    (* Your implementation here *)
} 

// create the HttpHandler using the remoting CE 
let fableWebApp = remoting musicStore {()} 

let configureApp (app : IApplicationBuilder) =
    // Add Giraffe to the ASP.NET Core pipeline
    app.UseGiraffe fableWebApp

let configureServices (services : IServiceCollection) =
    // Add Giraffe dependencies
    services.AddGiraffe() |> ignore

[]
let main _ =
    WebHostBuilder()
        .UseKestrel()
        .Configure(Action configureApp)
        .ConfigureServices(configureServices)
        .Build()
        .Run()
    0

src/saturn.html.body:
Setup Saturn
On your Saturn project, you reference the the shared API types:



For Saturn, you actually don't need a seperate package other than the Giraffe package. Install Fable.Remoting.Giraffe:
paket add Fable.Remoting.Giraffe --project path/to/Server.fsproj
Expose the API
You can now expose the API implementation into the application pipeline of Saturn
// Program.fs

open Saturn
open SharedModels
open Fable.Remoting.Server
open Fable.Remoting.Giraffe

let musicStore : IMusicStore = {
    (* Your implementation here *)
} 

// create the remoting handler using the remoting CE 
let fableWebApp = remoting musicStore {()} 

let app = application {
    url "http://127.0.0.1:8083/"
    router webApp
}

run app

src/client.html.body:
Client
On your client Fable project, you reference the the shared API types:



Now you need to install the client package: Fable.Remoting.Client:
paket add Fable.Remoting.Client --project path/to/Client.fsproj
Proxy creation
Now that you have installed the package, you can use it to create a proxy: An object with which you are able to call the server in a type-safe manner: 
open ShareModels
open Fable.Remoting.Client

// musicStore : IMusicStore
let musicStore = Proxy.remoting {()}

async {
    let! albums = musicStore.allAlbums() 
    for album in albums do
        printfn "%s (%s)" album.Title album.Genre
}
|> Async.StartImmediate

Webpack dev server configuration
When you are working with webpack-dev-server in developement mode, you want to re-route the HTTP requests from your developement server to ypur actual backend, for that you must use the following configuration for webpack, assuming you are running webpack-dev-server on port 8080 and your backend is running on port 8083. You would change this block:
devServer: {
  contentBase: resolve('./public'),
  port: 8080
}

to this:
devServer: {
  contentBase: resolve('./public'),
  port: 8080,
  // tell webpack-dev-server to re-route all requests 
  // from dev-server to the actual server
  proxy: {
    '/*': { 
      // assuming the suave server is running on port 8083
      target: "http://localhost:8083",
      changeOrigin: true
    }
}

src/dotnet-http-client.html.body:
Use a custom HttpClient
When constructing the proxy, you can provide your own HttpClient that the proxy uses under the hood to communicate with the server. This has many use cases, for example, when you want to use a secure client certificate, configure the headers of the requests or when you want to test the Giraffe/Saturn pipeline directly from the client using Kestrel's test HttpClient
// using ASP.NET Core's test server
let server = new TestServer(WebHostBuilder().UseStartup())

// the test server gives you a specialized HttpClient for testing
let client = server.CreateClient()

// route builder that specifies how the routes are built
let builder = (*  *)

// construct the proxy using the test HttpClient
let proxy = Proxy.custom builder client

// write tests
testCase "favoriteAlbums returns empty when database is empty"  
    proxy.call  server.favoriteAlbums()  @>
    |> Async.RunSyncronously 
    |> List.length 
    |> fun n -> Expect 0 n "List should be empty"

src/route-builder.html.body:
Custom Route Paths
By default, the path of the generated routes are of the form /{typeName}/{methodName}. For our IMusicStore type, the method createAlbum will have the route /IMusicStore/createAlbum. You can override this behaviour by providing your own route builder. For example, to prefix your route with /api you can use the following:
let routeBuilder (typeName: string) (methodName: string) = 
    sprintf "/api/%s/%s" typeName methodName

// now use it with remoting builder
let webApp = remoting musicStore {
    use_route_builder routeBuilder
}

Ofcourse, the routes must match both on client and server, so we override the behaviour on the client too:
// Assuming the function routeBuilder is shared 
// between the client and server
let musicStore = Proxy.remoting {
    use_route_builder routeBuilder
}

One last thing you need to consider if you are using webpack-dev-server is that you need to delegate the requests that start with /api from the developement server to the F# backend using the following configuration:
devServer: {
  contentBase: resolve('./public'),
  port: 8080,
  proxy: {
    // delegate the requests prefixed with /api/
    '/api/*': {
      target: "http://localhost:8083",
      changeOrigin: true
    }
}

src/error-handling.html.body:
Error Handling
You might ask: What happens when an exception is thrown on the server by one of the RPC methods? 
Fable.Remoting provides fine-grained way of dealing with errors. Unhandled exceptions are catched on the server and are passed off to a global exception handler of the type 
Exception -> RouteInfo -> ErrorResult

where ErrorResult is defined as:
type ErrorResult = 
    | Ignore
    | Propagate of obj

With ErrorResult you choose either to propagate a custom message back to the client or just ignore the error. You don't want the exception data (message or stacktrace) to be returned to the client. Either way, an exception will be thrown on the call-site from the client with a generic error message. If you chose to propagate a custom error message, it will be passed off to a global handler on the client, here is a full example:
open System

// Custom error will be propagated back to client
type CustomError = { errorMsg: string }

let errorHandler (ex: Exception) (routeInfo: RouteInfo) = 
    // do some logging
    printfn "Error at %s on method %s" routeInfo.path routeInfo.methodName
    // decide whether or not you want to propagate the error to the client
    match ex with
    | :? System.IOException as x ->
        // propagate custom error, this is intercepted by the client
        let customError = { errorMsg = "Something terrible happend" }
        Propagate customError
    | :? System.Exception as x ->
        // ignore error
        Ignore

Use the error handler using the remoting builder:
let webApp = remoting musicStore {
    use_error_handler errorHandler
}

On the client, you can intercept the propagated custom error messages, also using a global handler (in either ways, whether you chose to ignore or propage a custom error, an exception is thrown on the local call-site):
// Assuming the type CustomError is shared with the client too

let errorHandler (info: ErrorInfo) = 
    let customError = ofJson errorInfo.error
    printfn "Oh noo: %s" custromError.errorMsg)

let musicStore = Proxy.remoting {
    use_error_handler errorHandler
}

src/modeling-authentication.html.body:
Modeling Authentication
When it comes to web applications, authentication and authorization are usually implemented in terms of cookies and headers of requests and responses, this is not the case when using Fable.Remoting to implement security features. This is because we are only using stateless pure functions and thus we need to "forget" about HTTP (headers/cookies/session state) when modeling authentication and authorization for our application.  

Note: the following modeling technique is the recommended implementation of auth when using Fable.Remoting. However, it is not the only way and it is still possible to use Http  mechanisms (headers/cookies) to secure your end points, see Implicit Authentication.

The following API models a book store interface with some of the functions requiring the user to be logged in and other functions to publicly available. We use stateless tokens that we pass around to authenticate or authorize the users:
// Shared.fs

type AuthToken = AuthToken of string
type LoginInfo = { Username: string; Password: string }

// possible errors when logging in
type LoginError = 
    | UserDoesNotExist
    | PasswordIncorrect
    | AccountBanned

// a request with a token
type SecureRequest = { Token : AuthToken; Content : 't }

// possible authentication/authorization errors     
type AuthError = 
   | UserTokenExpired
   | TokenInvalid
   | UserDoesNotHaveAccess

type BookId = BookId of int
// domain model
type Book = { Id: BookId; Title: string; (* other propeties *) }

// things that could go wrong 
// when removing a book from a users wishlist
type BookRemovalFromWishlist = 
    | BookSuccessfullyRemoved
    | BookDoesNotExist

// the book store protocol
type IBookStoreApi = {
    // login to acquire an auth token   
    login : LoginInfo -> Async>
    // "public" function: no auth needed
    searchBooksByTitle : string -> Async> 
    // secure function, requires a token
    booksOnWishlist : AuthToken -> Async, AuthError>>, 
    // secure function, requires a token and a book id
    removeBookFromWishlist : SecureRequest -> Async>
    // etc . . . 
}

Just by looking at the types you can tell what the application does. Implementing such interface on the server requires that you generate an authorization/authentication token when invoking the login function, JSON Web Tokens are good match for this type of scenario's and then use the resulting token in subsequent requests. There is no implicit logged in user nor some "user context", everything is stateless and explicit. 
The drawback of this approach is that you have to validate the auth token yourself for every secure function.

src/request-context.html.body:
Accessing Request Context
Sometimes you might need to read data from the incoming request, Maybe to validate a request header or to do some kind of logging. In This section, we will demonstrate the techniques of building an implementation from protocol specs that has both per-request and static dependencies where the following holds:

No change of the protocol specification is required
The implementation of the protocol specification is fully unit-testable without involving the Http pipeline 

For the following example, assume that we will be needing the values of the headers as key-value pair (i.e. of type Map) this will our per-request dependency, as a static dependency we will be needing a database that our implementation can call to get the actual album data.
type IMusicDb = 
    abstract getAwesomeAlbums : unit -> Album list 
    abstract getBoringAlbums : unit -> Album list 

// shared protocol specification
type IMusicStore = {
    bestAlbums : Async
}

// factory function that creates protocol implementation, 
// it depeneds on incoming headers from request and on a static database implementation 
let createMusicStore (db: IMusicDb) (headers: Map) : IMusicStore = 
    let musicStore = {
        bestAlbums = async {
            match Map.tryFind "Special-Header" headers with 
            | Some "Special-Value" -> return db.getAwesomeAlbums()
            | None -> return db.getBoringAlbums()
        }
    }

    musicStore

So far, as you can see, the code doesn't do anything with the HttpContext and it is unit-testable. Infact, this implementation doesn't care in what type of server it will be hosted in. 
Now we need to read the headers from the request and pass them to the factory, we do this by using the context handler that gives us access to the context of the incoming request, in Suave this context combinator is built-in so that you can use it as follows: 
let createWebApp (db: IMusicDb) : WebPart = context 
    // Here is where we access the context to extract the headers
    let headers = Map.ofList ctx.request.headers
    // construct the music store 
    let musicStore = createMusicStore db headers 
    // expose the music store as a WebPart
    remoting musicStore {()}

In Giraffe/Saturn, the context combinator isn't built-in but it is easy to define it:
let context (f: HttpContext -> HttpHandler) : HttpHandler =
    fun (next: HttpFunc) (ctx : HttpContext) -> 
        task {
            let handler = f ctx
            return! handler next ctx 
        }

let createWebApp (db: IMusicDb) : HttpHandler = context 
    // Here is where we access the context to extract the headers
    let headers = 
        [ for pair in ctx.Request.Headers do 
            let key = pair.Key 
            let value = pair.Value.[0] 
            yield key, value ]
        |> Map.ofList 

    // construct the music store 
    let musicStore = createMusicStore db headers 

    // expose the music store as a HttpHandler
    remoting musicStore {()}

Finally, in order to build the WebPart or HttpHandler, you will need to provide database implementation for IMusicDb :
let musicDb : IMusicDb = { 
    new IMusicDb with 
       member self.getAwesomeAlbums() = (* ... *) 
       member self.getBoringAlbums() = (* ... *) 
}

// webApp : WebPart / HttpHandler 
let webApp = createWebApp musicDb

That is it, we have now exposed our musicStore implementation to the world as an Http web service. 
We can now also write some unit tests for the implementation:
testCase "Boring albums are returned when there is no special header" 
    let musicDbMock : IMusicDb = {
        new IMusicDb with 
          member self.getAwesomeAlbums() = [ { Id = 1; Name = "Metallica" } ]
          member self.getBoringAlbums() = [ ] 
    }  

    let headers = Map.ofList [ "Content-Length", "70" ]
    let musicStore = createMusicStore musicDbMock headers

    musicStore.bestAlbums
    |> Async.RunSynchronously 
    |> List.length 
    |> fun n -> Expect.equal 0 n "List should be empty"

src/logging.html.body:
Logging
Logging is dead-simple to integrate with Fable.Remoting, if you are using Suave, then Suave.SerilogExtensions is what we recommend to use where Serilog is the logging framework of choice.

Suave.SerilogExtensions is specially written to work with Fable.Remoting, although it would work just great with any Suave app.
Logging extensions for Giraffe/Saturn are not yet available.

Basic use case
1 - Install from Nuget:
dotnet add package Suave.SerilogExtensions
# or if you are using paket
mono .paket/paket.exe add Suave.SerilogExtensions

2 - Wrap your remoting WebPart with the Serilog adapter:
open System
// ...
open Suave.SerilogExtensions
open Suave 

// Log unhandled exceptions 
let errorHandler (ex: Exception) 
                 (routeInfo: RouteInfo) =
    // get a contextual logger with RequestId attached to it
    let contextLogger = routeInfo.httpContext.Logger()
    // log the exception with relevant data
    let errorMsgTemplate = "Error occured while invoking {MethodName} at {RoutePath}"
    contextLogger.Error(ex, errorMsgTemplate, routeInfo.methodName, routeInfo.path)
    // No need to propagate custom errors back to client
    Ignore

// create the remoting WebPart
let webApp : WebPart = remoting musicStore {
    use_route_builder (sprintfn "/api/%s/%s")
    use_error_handler errorHandler 
}

// Enable logging
let webAppWithLogging : WebPart = SerilogAdapter.Enable(webApp)

3 - Create the logger and configure the sinks:
// configure Serilog
Log.Logger 
4 - Start the web server
startWebServer defaultConfig webAppWithLogging
Suave.SerilogExtensions contains many configuration options that you might want to check out. 
Using logger from remoting functions
Ofcourse, we don't want to just log the http requests and responses but we also want to log application specific and custom logs. To use Serilog from the remoting functions, you need to access to HttpContext and call httpContext.Logger() to get a contexual logger you can log events from. 

Logger() is an extension method provided from Suave.SerilogExtensions

Suppose your protocol had the type:
type IMusicStore = {
    albums : Async>
}

You can also gain access to the HttpContext from "outside" the remoting handler using the context helper function from Suave:
let webApp = context 
    let logger = httpContext.Logger()
    let musicStore : IMusicStore = {
        albums = async {
            logger.Information("Retrieving albums from database")
            let! albums = Database.getAllAlbums()
            logger.Information("Read {AlbumCount} albums from database", List.length albums)
            return albums
        }
    }

    // create and return the remoting WebPart
    remoting musicStore {
        use_route_builder (sprintfn "/api/%s/%s")
        use_error_handler errorHandler 
    }

// Wrap with Serilog adapter
let webAppWithLogging = SerilogAdapter.Enable(webApp)

startWebServer webAppWithLogging
